function identifyBase64Type(base64String) {
  try {
    // Remove Base64 prefix if present (data:image/png;base64, ...)
    const base64Data = base64String.split(",")[1] || base64String;

    // Decode first few bytes
    const buffer = Buffer.from(base64Data, "base64");

    // File Signature Mapping
    const signatures = [
      { signature: [0xff, 0xd8, 0xff], type: "JPEG Image" },
      { signature: [0x89, 0x50, 0x4e, 0x47], type: "PNG Image" },
      { signature: [0x47, 0x49, 0x46, 0x38], type: "GIF Image" },
      { signature: [0x52, 0x49, 0x46, 0x46], type: "AVI Video" },
      { signature: [0x66, 0x74, 0x79, 0x70], type: "MP4 Video" },
      { signature: [0x1a, 0x45, 0xdf, 0xa3], type: "MKV Video" },
      { signature: [0x49, 0x44, 0x33], type: "MP3 Audio" },
      { signature: [0x25, 0x50, 0x44, 0x46], type: "PDF Document" },
    ];

    // Compare the first bytes
    for (let { signature, type } of signatures) {
      if (signature.every((byte, index) => buffer[index] === byte)) {
        return type;
      }
    }

    return "Unknown format";
  } catch (error) {
    return `Error decoding Base64: ${error.message}`;
  }
}

